function (ele) { 
  try {
    if (ele.values.container && ele.values.item) {
      return `${ele.name} item container`
    }
    if (ele.values.container) {
      return `${ele.name} container`
    }
    if (ele.values.item) {
      return `${ele.name} item`
    }
  } catch(e) {
    return ele.name
  }
}
